import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { useNavigate } from 'react-router-dom';
import { classifyQuery } from '../services/queryService'; // Import your actual service

const ProfessionalDashboard = ({ initialData = null, userInfo = { name: 'Olivia' } }) => {
  const [query, setQuery] = useState('');
  const [selectedProfessional, setSelectedProfessional] = useState(null);
  const [professionals, setProfessionals] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();
  
  // Fetch professionals data from API or service
  useEffect(() => {
    const fetchProfessionals = async () => {
      try {
        setLoading(true);
        // This would be replaced with your actual API call
        // const response = await fetch('/api/professionals');
        // const data = await response.json();
        
        // For now, using mock data
        const mockData = initialData || [
          {
            id: 1,
            name: 'Ahmed Shayan',
            profession: 'Surgeon',
            location: 'Islamabad',
            income: '$250,000.00',
            success_rate: '36.2%',
            inquiries: {
              monthly: [7, 10, 4, 7, 9, 10, 7, 5, 12, 15, 25, 8],
              breakdown: { booked: 36.2, flopped: 63.8 }
            },
            income_data: {
              quarterly: { Q1: 13.1, Q2: 28.6, Q3: 28, Q4: 30.3 },
              monthly: [8000, 22000, 12000, 27000, 38000, 35000, 29000, 28000, 40000, 38000, 35000, 32000]
            }
          }
        ];
        
        setProfessionals(mockData);
        
        // Set first professional as selected by default if none is selected
        if (mockData.length > 0 && !selectedProfessional) {
          setSelectedProfessional(mockData[0]);
        }
        
        setLoading(false);
      } catch (err) {
        console.error('Error fetching professionals:', err);
        setError('Failed to load professionals. Please try again later.');
        setLoading(false);
      }
    };
    
    fetchProfessionals();
  }, [initialData]);

  // Handle query submission
  const handleQuerySubmit = async (e) => {
    if (e.key === 'Enter' && query.trim()) {
      try {
        setLoading(true);
        
        // Use the service to process the query
        const response = await classifyQuery(query.trim());
        
        // Process the response as needed
        console.log('Query response:', response);
        
        // You could update the UI based on the response
        // For example, highlighting matching professionals
        
        setLoading(false);
      } catch (err) {
        console.error('Error processing query:', err);
        setError('Error processing query: ' + (err.message || 'Unknown error'));
        setLoading(false);
      }
    }
  };

  const months = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];

  // Function to handle view mode changes
  const handleViewModeChange = (mode) => {
    // Implement view mode switching logic
    console.log(`Switched to ${mode} view mode`);
  };

  // Handle changing locations
  const handleChangeLocation = () => {
    navigate('/location');
  };

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Left Sidebar - Professional List */}
      <div className="w-64 bg-gray-900 text-white">
        <div className="p-4">
          <h1 className="text-2xl font-bold mb-6">Skill-S</h1>
          
          {loading ? (
            <div className="text-center py-6">Loading professionals...</div>
          ) : error ? (
            <div className="text-red-400 py-6">{error}</div>
          ) : (
            professionals.map(pro => (
              <div 
                key={pro.id}
                className={`mb-4 rounded-lg p-4 cursor-pointer transition-colors duration-300 ${selectedProfessional?.id === pro.id ? 'bg-indigo-700' : 'bg-indigo-600'}`}
                onClick={() => setSelectedProfessional(pro)}
              >
                <div className="flex items-center mb-2">
                  <div className="w-10 h-10 rounded-full bg-gray-300 mr-3"></div>
                  <span className="font-semibold">{pro.name}</span>
                </div>
                <div className="text-3xl font-bold mb-2">{pro.profession}</div>
                <div className="flex justify-between items-center">
                  <span>{pro.location}</span>
                  <span className="text-sm">More â†’</span>
                </div>
              </div>
            ))
          )}
        </div>
      </div>

      {/* Main Content */}
      <div className="flex-1 flex flex-col">
        {/* Top Navigation */}
        <header className="bg-white shadow p-4 flex justify-between items-center">
          <div className="flex items-center">
            <div className="w-8 h-8 rounded-full bg-gray-300 mr-2"></div>
            <span className="font-medium">Hello {userInfo.name}</span>
          </div>
          <div className="flex">
            <button className="mr-4 px-4 py-2 border rounded flex items-center">
              <span className="mr-2">Save preferences</span>
            </button>
            <button className="px-4 py-2 border rounded flex items-center">
              <span className="mr-2">View Preferences</span>
            </button>
          </div>
        </header>

        <div className="flex-1 flex">
          {/* Middle Section - Professional Details */}
          <div className="flex-1 p-4 overflow-auto">
            <div className="mb-4">
              <div className="flex space-x-4 mb-4">
                <button 
                  className="px-6 py-2 rounded border transition-colors hover:bg-gray-100"
                  onClick={() => handleViewModeChange('textual')}
                >
                  Textual
                </button>
                <button 
                  className="px-6 py-2 rounded border transition-colors hover:bg-gray-100"
                  onClick={() => handleViewModeChange('visualized')}
                >
                  Visualized
                </button>
              </div>
            </div>
            
            {loading ? (
              <div className="flex justify-center items-center h-64">
                <div className="text-lg text-gray-500">Loading professional data...</div>
              </div>
            ) : error ? (
              <div className="bg-red-100 text-red-700 p-4 rounded">
                {error}
              </div>
            ) : selectedProfessional ? (
              <div className="grid grid-cols-2 gap-4">
                {/* Top Stats */}
                <div className="bg-white p-4 rounded-lg shadow">
                  <div className="text-gray-500 mb-2">Total Income</div>
                  <div className="text-2xl font-bold">{selectedProfessional.income}</div>
                </div>
                
                <div className="bg-white p-4 rounded-lg shadow">
                  <div className="text-gray-500 mb-2">Inquiry Success Rate</div>
                  <div className="text-2xl font-bold">{selectedProfessional.success_rate}</div>
                </div>
                
                {/* Inquiry Breakdown */}
                <div className="bg-white p-4 rounded-lg shadow">
                  <div className="text-gray-500 mb-4">Inquiry Breakdown</div>
                  <div className="flex justify-center">
                    <div className="w-40 h-40 rounded-full border-8 border-purple-400 relative flex items-center justify-center">
                      <div className="absolute inset-0 flex items-center justify-center">
                        <div className="text-center">
                          <div>Booked</div>
                          <div>{selectedProfessional.inquiries.breakdown.booked}%</div>
                        </div>
                      </div>
                      <div className="absolute bottom-0 left-0 pl-4 pb-4">
                        <div>Flopped</div>
                        <div>{selectedProfessional.inquiries.breakdown.flopped}%</div>
                      </div>
                    </div>
                  </div>
                </div>
                
                {/* Inquiries per Month */}
                <div className="bg-white p-4 rounded-lg shadow">
                  <div className="text-gray-500 mb-2">Inquiries per Month</div>
                  <div className="h-48 flex items-end justify-between">
                    {months.map((month, i) => (
                      <div key={month} className="flex flex-col items-center">
                        <div className="w-6 bg-purple-400 rounded-t" 
                             style={{height: `${selectedProfessional.inquiries.monthly[i] ? (selectedProfessional.inquiries.monthly[i]/25)*100 : 0}%`}}></div>
                        <div className="text-xs mt-1">{month}</div>
                      </div>
                    ))}
                  </div>
                </div>
                
                {/* Income per Quarter */}
                <div className="bg-white p-4 rounded-lg shadow">
                  <div className="text-gray-500 mb-4">Income per Quarter</div>
                  <div className="flex justify-center">
                    <div className="w-40 h-40 rounded-full border-8 border-purple-400 relative">
                      {/* Quarter data would go here - simplified for this example */}
                      <div className="absolute top-0 left-0 pl-4 pt-4">
                        <div>Q1</div>
                        <div>{selectedProfessional.income_data.quarterly.Q1}%</div>
                      </div>
                      <div className="absolute top-0 right-0 pr-4 pt-4">
                        <div>Q2</div>
                        <div>{selectedProfessional.income_data.quarterly.Q2}%</div>
                      </div>
                      <div className="absolute bottom-0 right-0 pr-4 pb-4">
                        <div>Q3</div>
                        <div>{selectedProfessional.income_data.quarterly.Q3}%</div>
                      </div>
                      <div className="absolute bottom-0 left-0 pl-4 pb-4">
                        <div>Q4</div>
                        <div>{selectedProfessional.income_data.quarterly.Q4}%</div>
                      </div>
                    </div>
                  </div>
                </div>
                
                {/* Income per Month */}
                <div className="bg-white p-4 rounded-lg shadow">
                  <div className="text-gray-500 mb-2">Income per Month</div>
                  <div className="h-48 flex items-end justify-between">
                    {months.map((month, i) => (
                      <div key={`inc-${month}`} className="flex flex-col items-center">
                        <div className="w-6 bg-purple-400 rounded-t" 
                             style={{height: `${selectedProfessional.income_data.monthly[i] ? (selectedProfessional.income_data.monthly[i]/40000)*100 : 0}%`}}></div>
                        <div className="text-xs mt-1">{month}</div>
                      </div>
                    ))}
                  </div>
                </div>
              </div>
            ) : (
              <div className="flex justify-center items-center h-64">
                <div className="text-lg text-gray-500">Select a professional to view details</div>
              </div>
            )}
          </div>

          {/* Right Sidebar - Chat Input */}
          <div className="w-64 bg-blue-100 p-4 flex flex-col">
            <div className="flex-1 flex items-center justify-center">
              <div className="text-center p-4">
                <h2 className="text-xl font-bold mb-4">Interview Professionals</h2>
                <div className="mt-8 text-lg mb-2">Idhr input</div>
                <div className="text-lg">output hoga</div>
              </div>
            </div>
            <div className="mt-auto">
              <div className="relative">
                <input 
                  type="text" 
                  placeholder="Input Query"
                  value={query}
                  onChange={(e) => setQuery(e.target.value)}
                  onKeyPress={handleQuerySubmit}
                  className="w-full pl-10 pr-4 py-2 rounded-full border"
                />
                <div className="absolute left-3 top-2">
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-gray-400" viewBox="0 0 20 20" fill="currentColor">
                    <path fillRule="evenodd" d="M8 4a4 4 0 100 8 4 4 0 000-8zM2 8a6 6 0 1110.89 3.476l4.817 4.817a1 1 0 01-1.414 1.414l-4.816-4.816A6 6 0 012 8z" clipRule="evenodd" />
                  </svg>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProfessionalDashboard;
